import React from "react";
import IconButton from "@material-ui/core/IconButton";

export default function Authenticated() {
  return (
    <div>
      <IconButton
        aria-label="account of current user"
        aria-controls="menu-appbar"
        aria-haspopup="true"
        color="inherit"
      ></IconButton>
    </div>
  );
}
